import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './note.css';

class Notes extends React.Component{


    render(){
            
        return(
            <div>
                <div className="container-fluid">
                    <h1>hello world</h1>
                </div>
            </div>
        )
    }
}

export default Notes;
